import React from 'react'
import './css/Field.css'

function Field ({ text, name, value, onChange }) {
  return (
    <div className='Field'>
      <label className='input'>
        <input
          className='input__field'
          type='text'
          placeholder=' '
          name={name}
          value={value}
        />
        <span className='input__label'>{text}</span>
      </label>
    </div>
  )
}

export default Field
